import { AppBar, Toolbar, Box, Stack, Typography, IconButton, Switch, Divider, Drawer,
	List,
	ListItem,
	ListItemText,
	InputAdornment,
	Checkbox } from "@mui/material";
import React from "react";
import useMediaQuery from "@mui/material/useMediaQuery";
import { useState, useEffect, useCallback } from "react";
import LeftSection from "./LeftSection";
import RightSection from "./RightSection";
import Hero from "./Hero";
import SignUp from "./SignUp";
import Footer from "../Footer";
import OpportunitiesImage from "../Landing/viewposts.png";
import RelationshipImage from "../Landing/discussionpost.png";
import Video from "../Landing/cardiacrehab.mp4"
import SummariesImage from "../Landing/message.png";
import Banner from "./Banner";
import Image from "../Landing/Auditboard.png"
import { styled } from "@mui/material/styles";
import ButtonBase from "@mui/material/ButtonBase";
import { Grid, Paper } from "@mui/material";
import TextField from '@mui/material/TextField';
import firestore from '../../Utilities/firebase';
import { doc, setDoc, collection, getDocs, writeBatch } from "firebase/firestore"; 
import Logo from "../../images/Logo.svg";

import ExpandedCard from "./ExpandedCard";
import SearchIcon from "@mui/icons-material/Search";

import { navigateTo } from "../../Utilities/navigate";
import { useNavigate, Link } from "react-router-dom";

import Avatar from "@mui/material/Avatar";
import Button from "@mui/material/Button";
import CssBaseline from "@mui/material/CssBaseline";
import LockOutlinedIcon from "@mui/icons-material/LockOutlined";
import Container from "@mui/material/Container";
import Modal from "@mui/material/Modal";
import CloseIcon from '@mui/icons-material/Close';
import emailjs from '@emailjs/browser';

const ViewPosts = () => {
    const navigate = useNavigate();

    return (
        <div 
			style={{
				backgroundColor: "#fbe4d8",
				width: "100vw",
				height: "100vh"
			}}>
			<CssBaseline />
            <AppBar
				position="fixed"
				sx={{ zIndex: 1400, 
					  height: 96,
					  boxShadow: "none",
					  overflow: "visible"
				}}
			>
				<Container maxWidth='xl'>
					<Toolbar sx={{ justifyContent: "space-between" }}>
						<Box sx={{ display: { xs: "none", md: "flex" }, pt: 4, pb: 3 }}>
							<img src={Logo} width={140} alt='Logo' />
						</Box>
						<Stack
							sx={{ flexGrow: 0, display: { xs: "none", md: "flex" }, pt: 4, pb: 3 }}
							direction='row'
							>
								<Typography
									variant='body3'
									noWrap
									component='a'
									sx={{
										mr: 8,
										display: "flex",
										fontFamily: '"Rosart", "Georgia", "Times New Roman", "FZNewBaoSong", serif',
										fontWeight: 500,
										color: "#190019",
										textDecoration: "none",
										flexGrow: 1,
										cursor: "pointer",
									}}>
									ABOUT ME
								</Typography>
								<Typography
									variant='body3'
									noWrap
									component='a'
									sx={{
										mr: 8,
										display: "flex",
										fontFamily: '"Rosart", "Georgia", "Times New Roman", "FZNewBaoSong", serif',
										fontWeight: 500,
										color: "#190019",
										textDecoration: "none",
										flexGrow: 1,
										cursor: "pointer",
									}}>
									PROJECTS
								</Typography>
								<Typography
									variant='body3'
									noWrap
									component='a'
									sx={{
										mr: 8,
										display: "flex",
										fontFamily: '"Rosart", "Georgia", "Times New Roman", "FZNewBaoSong", serif',
										fontWeight: 500,
										color: "#190019",
										textDecoration: "none",
										flexGrow: 1,
										cursor: "pointer",
									}}>
									EXPERIENCES
								</Typography>
								<Typography
									variant='body3'
									noWrap
									component='a'
									sx={{
										display: "flex",
										fontFamily: '"Rosart", "Georgia", "Times New Roman", "FZNewBaoSong", serif',
										fontWeight: 500,
										color: "#190019",
										textDecoration: "none",
										flexGrow: 1,
										cursor: "pointer",
									}}>
									CONTACT ME
								</Typography>
						</Stack>
					</Toolbar>
					<div
                    style={{
                        borderBottom: "1px solid black",
                        marginLeft: "18px", // Adjust the left gap
                        marginRight: "18px", // Adjust the right gap
                    }}
					/>
				</Container>
			</AppBar>
            <section style={{ paddingTop: '96px' }}>
                    <Box>
                        <Typography>
                            Hello
                        </Typography>
                        {/* Add more content for the rest of the webpage */}
                    </Box>
            </section>
        </div>
    );
};

export default ViewPosts;
